description:
Brilliant, charming piece of fluff with excellent production values and an awesome cast: Georgina Spelvin, John Leslie, Lesllie Bovee, Paul Thomas, Clair Dia and both halves of A&amp;A in great form. This is one of those movies (&quot;Naked Afternoon&quot; is another) which make it clear that Abigail Clayton had a boobjob later on in her career. Here we have the natural Abby; the breasts are clearly smaller and bouncier than the versions in &quot;Health Spa&quot; and &quot;Seven into Snowy&quot;. Mind you, it has taken some major consultations with Peter and some frame-by-frame action to firmly establish this unfortunate event.

